def identify_outliers(sparse_data):
    outlier_classifier = svm.OneClassSVM(nu=0.15, kernel='rbf', gamma='auto', verbose=True)
    y = outlier_classifier.fit_predict(sparse_data)
    #list of outlier samples
    print([i for i in range(len(y)) if y[i] < 0])


