def variance_plot(data):
    # colors = np.array(['#377eb8', '#ff7f00'])

    pca = PCA(n_components=2)
    pca.fit(data)
    print(len(data))
    high_var_feature_indices = pfa_keep#= np.load("list of chosen features.npy")
    print(high_var_feature_indices)
    expl_var_1, expl_var_2 = pca.explained_variance_ratio_
    #plt.scatter(X[:, 0], X[:, 1], s=10, )
    print(len(pca.components_[0, :]))
    colors = ['#377eb8' if y in high_var_feature_indices else '#ff7f00' for y in range(len(data[0]))]

    plt.scatter(pca.components_[0, :], pca.components_[1, :], color=colors, s=1)
    #for i in range(len(data)):
        #print(pca.components_[0, i])

    plt.xlabel(f'1st PCA component, {100 * expl_var_1:.1f}% variance')
    plt.ylabel(f'2nd PCA component, {100 * expl_var_2:.1f}% variance')
    plt.title('First 2 PCA components')
    plt.show()

